const vid = $("Start").first().json.YT_Video_ID;
const list1 = $("Start").first().json.list1;
const list2 = $("Start").first().json.list2;
const have = {};
const dhave = {};
if (typeof list2[0].json.snippet !== "undefined") {
for (let h=0; h < list1.length; h++) {
  let title1 = list1[h];
  for (let i=0; i < list2.length; i++) {
    let title2 = list2[i].json.snippet.title;
    if (title2.toLowerCase() === title1.toLowerCase()) {
      have[title1.toLowerCase()] = {title: title1, vid: vid, lid: list2[i].json.id};
      break;
    }
  }
}
}
const haves = Object.keys(have);
for (const content of list1) {
  if (haves.includes(content.toLowerCase())) {
    continue;
  }
  dhave[content.toLowerCase()] = {title: content};
}
return {haves: have, have_nots: dhave}

