# Haves and Have Nots

## SWF024

### Purpose
Enable code changes to be applied for multiple users simultaneously, reducing update time. The workflow compares items in list1 against list2: matches are returned in the haves array, while nonâ€‘matches are returned in the have_nots array.

### Input
* YT_Video_ID
* list1
* list2

### Output
* haves
    * [title: "...", "vid": "video id from input", "lid": "playlist id"]
    * Example:
```
[
  {
    "haves": {
      "ohio_news": 
      {
        "title": "Ohio_news",
        "vid": "vX-CHe27_ks",
        "lid": "PLTfdPnFMpg8JNVEjL_xlYwPy1I-6bmMFg"
      },
      "ohio_statehouse": 
      {
        "title": "Ohio_Statehouse",
        "vid": "vX-CHe27_ks",
        "lid": "PLTfdPnFMpg8KkeyYJ25mVgaTwzKBF48Y8"
      }
    }
  }
]
```
* have_nots
    * [title: "..."]
    * Example:
```
[
  {
    "have_nots": 
    {
      "ohio_news": 
      {
        "title": "Ohio_news"
      },
